import React, { Component } from 'react';

class Index extends Component {
  constructor(props) {
    super(props);
  }
  static async getInitialProps() {
    return { res: console.log('fetching your data') };
  }

  render() {
    return (
      <>
        <h1>our index page</h1>
      </>
    );
  }
}

